import React from "react";

const ResultBox = ({ result }) => {
  if (!result) return null;

  return (
    <div
      style={{
        marginTop: "20px",
        padding: "10px",
        borderRadius: "5px",
        backgroundColor: result.isSpam ? "#ffcccc" : "#ccffcc"
      }}
    >
     <strong>Result:</strong> {JSON.stringify(result, null, 2)}

    </div>
  );
};

export default ResultBox;
